import { createApp } from 'vue'
import App from './App.vue'
import eventbus  from './plugins/eventbus'
import router from './router/router.js';
import resource from './js/resource/resource';
const app= createApp(App);
app.use(eventbus);
app.use(resource);
app.use(router);
app.mount('#app')
